= Defining a custom phenotype list =

{{box cssClass="floatinginfobox" title="**Contents**"}}
{{toc depth="3"/}}
{{/box}}

Patient forms usually have a predefined list of phenotypes that can be "checked" by the users, which is displayed on the left column of the **Clinical symptoms & physical findings** section. These lists display a subset of the thousands of phenotypes defined by the [[Human Phenotype Ontology (HPO)>>http://human-phenotype-ontology.org]], usually consisting of the most commonly investigated features within a specific study that are made readily available for the user. This list can be configured from the [[administration>>AdminGuide.DataConfiguration]] by selecting from a number of predefined configurations.

For administrators who are also [[advanced users>>http://platform.xwiki.org/xwiki/bin/view/Features/PageEditing]] of the system, a form for creating additional phenotypes configurations is displayed in the **Phenotypes displayed by default** admin section. The administrator is prompted for a name for the new phenotype configuration, and upon submission will be directed to a form where the new configuration data should be entered (together with a title and optional description).

The expected format of this configuration currently relies on the [[Velocity>>http://velocity.apache.org/engine/devel/vtl-reference-guide.html]] scripting language [[as supported by the XWiki platform>>http://platform.xwiki.org/xwiki/bin/view/DevGuide/Scripting#HVelocitySpecificInformation]], and will generally appear in this form:

{{code language="velocity"}}
{{velocity}}
#set($phenotype = <List of sections in JSON format>)
#set ($mappings = {
  "phenotype": $phenotype
})
{{/velocity}}
{{/code}}

{{info}}We will transition to configurations in pure [[JSON>>http://www.json.org/]] format shortly. We would also like to provide a visual wizard that allows to build the configuration without any prior knowledge of programming. However, this wizard is not currently a top priority for the PhenoTips development team, and contributions from interested JavaScript/Web developers are welcome.{{/info}}

