== Structure explained ==
The configuration defines **list of sections** :

{{code language="javascript"}}
[
  <section>,
  <section>,
  ...
  <section>
]
{{/code}}

=== Sections ===

A **section** is defined by the following information:
; ##type##
: must be ##section## and is mandatory
; ##title##
: is the title of the section as it should be displayed in the form and is mandatory
; ##categories##
: defines a list of (one or more) [[HPO>>http://human-phenotype-ontology.org]] terms which are the roots of the branches of the ontology that are covered by this section; for data consistency, the ##id##s of any of the entries listed in the ##data## field of the section should have one of these categories as an ancestor in the ontology; this field is mandatory and the values are used for restricting the domain of the suggestions provided to the users when they search for ontology terms in the section's search box (labeled //Other//)
; ##data##
: defines a list of entries (either **subsections** or simple **fields**) that are to be displayed in this section; it is mandatory but can be empty

=== Subsections ===

A **subsection** can appear listed in the ##data## field of a section and is defined by the following information:
; ##type##
: must be ##subsection## and is mandatory
; ##id##
: is an [[HPO>>http://human-phenotype-ontology.org]] term which, for data consistency, should be an ancestor (or preferably direct parent) of all the entries listed in the ##data## field of the subsection
; ##title##
: is the title of the subsection as it should be displayed in the form and is mandatory
; ##data##
: defines a list of **fields** that are to be displayed in this subsection; it is mandatory but can be empty

=== Fields ===

A **field** can appear listed in the ##data## field of a section or a subsection and is defined by the following information:
; ##type##
: is optional, and must be ##field## if defined
; ##id##
: is an [[HPO>>http://human-phenotype-ontology.org]] term, which is the actual value that will be stored in the database if the user "checks" this field in the patient form; if the term has descendants in the [[HPO>>http://human-phenotype-ontology.org]] structure, it will be automatically preceded by an arrow (â–º) symbol when displayed, which will allow users to immediately browse and select its descendants
; ##title##
: is the title of the entry as it should be displayed in the form; it is optional, and if it is missing, the name of the [[HPO>>http://human-phenotype-ontology.org]] term defined by the field's ##id# is used by default
